import './App.css';
import React from 'react';
import Header from './Header';
import Home from './Home';
import  {BrowserRouter as Router, Switch, Route}
from "react-router-dom"

function App() {
  return (
    <Router>

      <div className="App">

        <Routes>



          <Route path="/" element={[<Header />, <Home />]} />



          <Route path="/checkout" element={<Header />} />



        </Routes>

      </div>


    <div className="app">
      <Home />
    </div>
    </Router>
  );
}

export default App;
